import React from 'react'
import update from 'immutability-helper'
import {browserHistory} from 'react-router'

import axios from 'axios'

class LibroReclamos extends React.Component{
    constructor (props){
        super (props)
        this.state = {
            datos: {
                fecha: '',
                nombres: '',
                direccion: '',
                documento: '',
                telefono: '',
                email: '',
                menor: false,
                producto: false,
                servicio: false,
                monto: '',
                descripcion: '',
                reclamo: false,
                queja: false,
                detalle: '',
                pedido: ''
            },
            error: {
                nombres: '',
                direccion: '',
                documento: '',
                telefono: '',
                email: '',
                detalle: '',
                pedido: ''
            },
            message: ''
        }
    }

    componentDidMount() {
        window.scrollTo(0, 0)
    }

    handleinput = (e) => {
        e.preventDefault()

        let id = e.target.id
        let value = e.target.value

        this.setState (update (this.state, {
            datos:{
                [id]: {$set: value}
            }
        }))
    }

    handlechange = (e) => {
        e.preventDefault ()

        let id = e.target.id

        if (id === 'menor'){
            this.setState(update(this.state, {
                datos: {
                    menor: {$set: !this.state.datos.menor}
                }
            }))
        } else if (id === 'producto') {
            if (!this.state.datos.producto && !this.state.datos.servicio){
                this.setState(update(this.state, {
                    datos: {
                        producto: { $set: true }
                    }
                }))
            } else {
                this.setState(update(this.state, {
                    datos: {
                        producto: { $set: !this.state.datos.producto },
                        servicio: { $set: !this.state.datos.servicio }
                    }
                }))
            }
        } else if (id === 'servicio') {
            if (!this.state.datos.producto && !this.state.datos.servicio) {
                this.setState(update(this.state, {
                    datos: {
                        servicio: { $set: true }
                    }
                }))
            } else {
                this.setState(update(this.state, {
                    datos: {
                        producto: { $set: !this.state.datos.producto },
                        servicio: { $set: !this.state.datos.servicio }
                    }
                }))
            }
        } else if (id === 'reclamo') {
            if (!this.state.datos.reclamo && !this.state.datos.queja) {
                this.setState(update(this.state, {
                    datos: {
                        reclamo: { $set: true }
                    }
                }))
            } else {
                this.setState(update(this.state, {
                    datos: {
                        reclamo: { $set: !this.state.datos.reclamo },
                        queja: { $set: !this.state.datos.queja }
                    }
                }))
            }
        } else if (id === 'queja') {
            if (!this.state.datos.reclamo && !this.state.datos.queja) {
                this.setState(update(this.state, {
                    datos: {
                        queja: { $set: true }
                    }
                }))
            } else {
                this.setState(update(this.state, {
                    datos: {
                        reclamo: { $set: !this.state.datos.reclamo },
                        queja: { $set: !this.state.datos.queja }
                    }
                }))
            }
        }
    }

    enviarreclamoqueja = (e) => {
        e.preventDefault ()


        if (this.state.datos.nombres === '' ||
            this.state.datos.direccion === '' || this.state.datos.documento === '' || 
            this.state.datos.telefono === '' || this.state.datos.email === '' ||
            this.state.datos.detalle === '' || this.state.datos.pedido === ''){
                if (this.state.datos.nombres === ''){
                    this.setState(update (this.state, {
                        error:{
                            nombres: { $set: 'Debe completar este campo obligatorio' },
                            direccion: { $set: '' },
                            documento: { $set: '' },
                            telefono: { $set: '' },
                            email: { $set: '' },
                            detalle: { $set: '' },
                            pedido: { $set: '' }
                        }
                    }))
                } else if (this.state.datos.direccion === '') {
                    this.setState(update(this.state, {
                        error: {
                            direccion: { $set: 'Debe completar este campo obligatorio' },
                            nombres: { $set: '' },
                            documento: { $set: '' },
                            telefono: { $set: '' },
                            email: { $set: '' },
                            detalle: { $set: '' },
                            pedido: { $set: '' }
                        }
                    }))
                } else if (this.state.datos.documento === '') {
                    this.setState(update(this.state, {
                        error: {
                            documento: { $set: 'Debe completar este campo obligatorio' },
                            nombres: { $set: '' },
                            direccion: { $set: '' },
                            telefono: { $set: '' },
                            email: { $set: '' },
                            detalle: { $set: '' },
                            pedido: { $set: '' }
                        }
                    }))
                } else if (this.state.datos.telefono === '') {
                    this.setState(update(this.state, {
                        error: {
                            telefono: { $set: 'Debe completar este campo obligatorio' },
                            nombres: { $set: '' },
                            direccion: { $set: '' },
                            documento: { $set: '' },
                            email: { $set: '' },
                            detalle: { $set: '' },
                            pedido: { $set: '' }
                        }
                    }))
                } else if (this.state.datos.email === '') {
                    this.setState(update(this.state, {
                        error: {
                            email: { $set: 'Debe completar este campo obligatorio' },
                            nombres: { $set: '' },
                            direccion: { $set: '' },
                            documento: { $set: '' },
                            telefono: { $set: '' },
                            detalle: { $set: '' },
                            pedido: { $set: '' }
                        }
                    }))
                } else if (this.state.datos.detalle === '') {
                    this.setState(update(this.state, {
                        error: {
                            detalle: { $set: 'Debe completar este campo obligatorio' },
                            nombres: { $set: '' },
                            direccion: { $set: '' },
                            documento: { $set: '' },
                            telefono: { $set: '' },
                            email: { $set: '' },
